export const Todo = ({ task, deleteTodo, editTodo, toggleCompletion }) => {
    return (
      <div className="Todo">
        <p className={`${task.completed ? 'completed' : 'incompleted'}`}>
          {task.task}
        </p>
        <div className="checkboxes">
          <label>
            <input
              type="checkbox"
              checked={task.completed}
              onChange={() => toggleCompletion(task.id, true)}
            />
            Done
          </label>
          <label>
            <input
              type="checkbox"
              checked={!task.completed}
              onChange={() => toggleCompletion(task.id, false)}
            />
            Not Done
          </label>
        </div>
        <div>
          <FontAwesomeIcon
            className="edit-icon"
            icon={faPenToSquare}
            onClick={() => editTodo(task.id)}
          />
          <FontAwesomeIcon
            className="delete-icon"
            icon={faTrash}
            onClick={() => deleteTodo(task.id)}
          />
        </div>
      </div>
    );
  };
